import React, { useEffect, useState } from "react";
import { retailerAPI } from "../services/api";
import { Link, useNavigate } from "react-router-dom";
import "./RetailerDashboard.css";

const RetailerDashboard = () => {
  const navigate = useNavigate();

  const [farmers, setFarmers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [retailer, setRetailer] = useState(null);

  // Load retailer from localStorage (safe JSON parse)
  useEffect(() => {
    let storedRetailer = null;
    try {
      const raw = localStorage.getItem("retailer");
      storedRetailer = raw ? JSON.parse(raw) : null;
    } catch (e) {
      console.warn("Failed to parse retailer from localStorage:", e);
      storedRetailer = null;
    }

    if (!storedRetailer) {
      navigate("/retailer/login");
      return;
    }
    setRetailer(storedRetailer);
  }, [navigate]);

  // Load Farmers WITH Their Products
  useEffect(() => {
    const fetchFarmers = async () => {
      try {
        const res = await retailerAPI.getAllFarmersWithProducts();
        const data = res?.data || [];

        // Sort so farmers with products appear first
        data.sort((a, b) => {
          const aHas = a.products?.length > 0;
          const bHas = b.products?.length > 0;
          return aHas === bHas ? 0 : aHas ? -1 : 1;
        });

        setFarmers(data);
      } catch (err) {
        console.error("Error loading farmers:", err);
      } finally {
        setLoading(false);
      }
    };

    fetchFarmers();
  }, []);

  // Clean logout ‚Äî clear storage and navigate (no reload)
  const handleLogout = () => {
    localStorage.removeItem("retailer");
    // if you store a token, clear it too
    localStorage.removeItem("retailerToken");
    navigate("/retailer/login", { replace: true });
  };

  if (loading) return <p className="loading">üåæ Loading farmers...</p>;

  return (
    <div className="dashboard">
      {/* ---------- HEADER ---------- */}
      <header className="dashboard-header-bar">
        <div className="logo">üåæ Product Tracking Blockchain</div>

        <nav className="nav-links">
          <Link to="/retailer/orders" className="nav-link">üì¶ My Orders</Link>
          <Link to="/retailer/delivered-orders" className="nav-link">‚úî Confirm Delivery</Link>
          <Link to="/retailer/cart" className="nav-link">üõç Cart</Link>

          <span className="welcome-text">
            Welcome, <b>{retailer?.storeName || retailer?.name}</b>
          </span>

          <button onClick={handleLogout} className="logout-btn">Logout</button>
        </nav>
      </header>

      {/* ---------- TITLE ---------- */}
      <section className="dashboard-title-section">
        <h1>Retailer Dashboard</h1>
        <p>Click a farmer to view their available products.</p>
        <hr className="section-divider" />
      </section>

      {/* ---------- FARMERS LIST ---------- */}
      <h2 className="section-label">üë®‚Äçüåæ Farmers</h2>

      <div className="farmer-list">
        {farmers.length === 0 ? (
          <p>No farmers available.</p>
        ) : (
          farmers.map((farmer) => (
            <div
              key={farmer.id}
              className="farmer-card clickable"
              onClick={() => navigate(`/retailer/farmer/${farmer.id}`)}
            >
              <h3 className="farmer-name">{farmer.name}</h3>

              <p><b>üìû Phone:</b> {farmer.phone}</p>
              <p><b>üìç Address:</b> {farmer.address || "N/A"}</p>

              <p className="product-count">
                {farmer.products?.length > 0
                  ? `üß∫ ${farmer.products.length} product(s)`
                  : "üö´ No products available"}
              </p>
            </div>
          ))
        )}
      </div>
    </div>
  );
};

export default RetailerDashboard;
